from typing import List

from nonebot import on_regex
from nonebot.adapters.onebot.v11 import Bot, MessageSegment, GroupMessageEvent

from plugins.nonebot_plugin_dalle.utils import normalize_b64

matcher = on_regex('^test$')


@matcher.handle()
async def main(bot: Bot, event: GroupMessageEvent):
    json = ['', '', '', '', '', '', '', '', '']
    forward_msg = []
    for image in json:
        forward_msg.append(MessageSegment.node_custom(
            content=MessageSegment.image(f'base64://{image}'),
            user_id=int(bot.self_id),
            nickname='河神'
        ))
    await send_forward_msg(bot, event, forward_msg)


async def send_forward_msg(
    bot: Bot,
    event: GroupMessageEvent,
    msgs: List[MessageSegment],
):
    await bot.call_api(
        "send_group_forward_msg", group_id=event.group_id, messages=msgs
    )
